import React from "react";
import AbdomenSelector from "./components/Abdomen/AbdomenSelector";
// import FingerSelector from "./components/Finger/FingerSelector";
import { Bs1CircleFill, BsArrowRight } from "react-icons/bs";

const App: React.FC = () => {
  return (
    <div className="flex-row justify-center h-screen bg-gray-100 px-4">
      <div className="flex items-center">
        <img className="w-20" src="/agnos-logo.png" alt="agnos-logo" />
        <h2 className="text-2xl font-bold py-8 leading-7 text-gray-900 sm:truncate sm:text-3xl sm:tracking-tight">
          {/* Welcome to Agnos Health Check */}
        </h2>
      </div>
      <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
        <h3 className="text-2xl font-normal mb-6 flex items-center">
          <Bs1CircleFill className="mr-2" />
          Select Pain Areas (Abdomen)
        </h3>
        {/* Abdomen */}
        <div className="mb-6">
          <AbdomenSelector />
          <div className="flex justify-">
            <button className="btn btn-primary text-white rounded-lg">
              Next <BsArrowRight />
            </button>
          </div>
        </div>
        {/* <h3 className="text-2xl font-normal mb-6 flex items-center">
          <Bs2CircleFill className="mr-2" />
          Select Pain Areas (Finger)
        </h3> */}
        {/* Finger */}
        {/* <div className="mb-6">
          <FingerSelector />
        </div> */}
      </div>
    </div>
  );
};

export default App;
